INSERT INTO `planet_types` (`type_id`, `type_name`, `type_habitable`, `type_comment`, `type_f_metal`, `type_f_crystal`, `type_f_plastic`, `type_f_fuel`, `type_f_food`, `type_f_power`, `type_f_population`, `type_f_researchtime`, `type_f_buildtime`, `type_collect_gas`, `type_consider`) VALUES
	(1, 'Erdähnlicher Planet', 1, 'Dieser Planet hat eine sehr ausgeglichene Umwelt und ähnelt unseren ehemaligen Erde am meisten. Da der Mensch ein Gewohnheitstier ist, sind erdähnliche Planeten ideal für das Heranwachsen einer Zivilisation geeignet, da die notwendigen Voraussetzungen für alle Bereiche gegeben sind.', 1.20, 0.90, 1.30, 1.05, 1.40, 1.10, 1.20, 1.00, 1.00, 0, 1),
	(2, 'Wasserplanet', 1, 'Die Oberfläche dieses Planeten besteht zum grössten Teil aus Ozeanen. Die wenigen Landteile sind nicht wirklich geeignet für grossflächigen Abbau von Mineralen, dafür kann aus dem Wasser Tritium gewonnen werden. Ebenfalls ist durch das viele vorhandene Wasser die Hauptgrundlage für Nahrungsabbau gelegt, ausserdem ist der Planet bestens geeignet, mit Hilfe von Wasserkraftwerken grosse Mengen an Energie zu erzeugen.', 1.00, 1.00, 1.05, 0.85, 1.10, 1.20, 1.00, 1.00, 0.85, 0, 1),
	(3, 'Wüstenplanet', 1, 'Wüste, Sand, Trockenheit und ein unwirtliches Klima zeichnet diesen Planetentyp aus. Der allgegenwärtige Sand hat aber auch etwas positives, denn aus ihm können grosse Mengen von wertvollem Silizium gewonnen werden.', 0.95, 1.45, 1.00, 0.90, 1.00, 0.90, 0.85, 0.85, 0.90, 0, 1),
	(4, 'Eisplanet', 1, 'Auf diesem unwirtlichen Planeten lockt einzig der Abbau von Tritium, welches sich aus den Eisschichen herausextrahieren lässt.\r\nVor kurzem haben Forscher eine neue chemische Methode entwickelt, aus Eismassen Silizium zu gewinnen. Diese neuartige Abbaumöglichkeit macht die Eisplaneten für Silizium-Anwender interessanter.', 1.10, 1.30, 1.25, 1.30, 0.95, 0.90, 1.00, 1.00, 1.00, 0, 1),
	(5, 'Dschungelplanet', 1, 'Riesige Wälder wachsen auf diesem Planeten, dessen Klima sehr gut für das Wachstum der Umwelt ist. Daher kann viel Nahrung für die Bevölkerung geerntet werden, welche sich auf einem Dschungelplaneten auch sonst sehr wohl fühlt.', 0.90, 1.20, 1.15, 1.20, 1.40, 1.00, 1.10, 1.00, 1.00, 0, 1),
	(6, 'Gebirgsplanet', 1, 'Den Namen hat dieser Planetentyp durch seine felsige Oberfläche erhalten. Ein Abbau von Erzen bietet sich optimalerweise an, hingegen ist der Abbau von Nahrung und die Herstellung von PVC mit Aufwand verbunden, da die Umgebung deren Anforderungen nicht gerecht wird.', 1.55, 1.00, 0.90, 0.90, 0.90, 1.10, 0.90, 1.00, 0.90, 0, 1),
	(8, 'Gasplanet', 0, 'Dieser Planet ist unbewohnbar, da er keine feste Oberfläche hat, sondern aus lauter gasartigen Nebeln besteht. Seine Gase lassen sich jedoch mit Hilfe von Gassaugern zu Tritium umwandeln.', 0.50, 0.60, 0.40, 2.00, 0.30, 1.20, 0.30, 1.20, 1.20, 1, 1);
INSERT INTO `races` (`race_id`, `race_name`, `race_comment`, `race_short_comment`, `race_adj1`, `race_adj2`, `race_adj3`, `race_leadertitle`, `race_f_researchtime`, `race_f_buildtime`, `race_f_fleettime`, `race_f_metal`, `race_f_crystal`, `race_f_plastic`, `race_f_fuel`, `race_f_food`, `race_f_power`, `race_f_population`, `race_active`) VALUES
	(1, 'Terraner', 'Die Terraner sind eine eher jüngere Rasse, deren Vorfahren ursprünglich vom Planeten Erde kamen. Die Menschen sind besonders gut in der Herstellung von Plastik und dem Anbau von Nahrung. Ihre Schwächen liegen im Abbau von Kristallen. ', 'Terraner bauen Ressourcen gleichmässig gut ab und haben relativ starke Schiffe.', 'terranischer', 'terranisches', 'terranische', 'Präsident der Terraner', 1.00, 1.00, 1.00, 1.15, 0.90, 1.25, 0.95, 1.40, 1.00, 1.00, 1),
	(2, 'Andorianer', 'Die Andorianer sind zugleich humanoid und insektoid. Sie haben graublaue Haut und weisses Haar. Auf ihrem Kopf haben sie zwei Fühler, die ihnen zur feinfühligen sinnlichen Wahrnehmung dienen. Ihre Stärke ist die Produktion künstlicher Stoffe wie Plastik. Ihre Schwäche ist der schlechte Umgang mit Energie.', 'Der Andorianer verfügt über grosses Wissen in der PVC-Herstellung', '', '', '', 'Schwarmführer der Andorianer', 1.00, 1.00, 1.00, 1.00, 1.10, 1.60, 1.00, 1.00, 1.00, 1.40, 1),
	(3, 'Rigelianer', 'Die Rigelianer stammen aus dem Rigel-System. Ihre Stärke liegt im Abbau von Kristallen, die für Steuereinheiten in Gebäuden und Schiffen verwendet werden. Da sie lange nur auf den Handel mit Silizium gesetzt haben, sind ihre Kenntnisse beim Abbau anderer Stoffe eher schlecht.', 'Spezialist in der Siliziumherstellung', '', '', '', 'Kaiser der Rigelianer', 1.00, 1.00, 1.00, 0.85, 1.80, 0.95, 1.00, 0.90, 1.00, 1.10, 1),
	(4, 'Orioner', 'Die Orioner sind eine humanoide Rasse aus der Nähe des Orions. Die Gesellschaft der Orioner besteht hauptsächlich aus Schmugglern und Piraten. Ihre Schiffe sind bekannt für ihre Schnelligkeit.', 'Orioner haben sich auf die Schnelligkeit der Schiffe spezialisiert', '', '', '', 'Kapitän der Orioner', 1.00, 1.00, 1.80, 1.10, 1.00, 0.90, 1.10, 1.00, 1.20, 1.10, 1),
	(5, 'Minbari', 'Die Minbari sind eine humanoide Rasse. Dadurch, dass sie den Rohstoff Erdöl nie gekannt haben, sind sie seit Ewigkeiten auf den Abbau von Tritium spezialisiert. Durch ihre enormen Treibstoffreserven und ihre grossen Anwendungskenntnisse von Tritium haben sie relativ schnelle Raumschiffe.', 'Eine Rasse mit schnellen Schiffen und grossem Wissen über Tritium.', 'minbarischer', '', 'minbarische', 'Vorsteher des Minbarikonzils', 1.00, 1.00, 1.20, 1.00, 1.00, 1.00, 1.60, 1.00, 1.00, 1.00, 1),
	(8, 'Centauri', 'Die Centauri haben sich auf Spionage spezialisiert. Deswegen haben sie ein Schiff entwickelt, welches Technologien stehlen kann. Des weiteren sind sie auf das Sammeln von Tritium in der Atmosphäre von Gasplaneten spezialisiert.', 'Kann Schiffe zum stehlen von Forschungen bauen.', '', '', '', 'Professor der Centauri', 1.00, 1.00, 1.00, 1.25, 1.15, 0.90, 1.25, 0.90, 1.10, 1.10, 1),
	(6, 'Ferengi', 'Die Ferengi sind eine humanoide Rasse. Sie sind etwas kleinwüchsiger als Menschen und  haben grosse Ohren. Die Stärke der Ferengi liegt beim Abbau von Metall.', 'Profi in der Titanherstellung', '', '', '', 'Grosser Nagus der Ferengi', 1.00, 1.00, 1.00, 1.55, 0.90, 1.00, 0.95, 1.00, 1.00, 1.00, 1),
	(7, 'Vorgonen', 'Die Vorgonen sind eine Rasse die auf den Schiffbau ausgelegt ist. Entsprechend sind sie vor allem im Beschaffen von Treibstoff und Kunststoff für den Bau der Schiffe gut.', 'Vorgonen können Schiffe ohne Start und Landezeit bauen.', '', '', '', 'Architekt der Vorgonen', 1.00, 1.00, 1.10, 0.95, 0.95, 1.40, 1.20, 1.10, 1.10, 1.00, 1),
	(9, 'Cardassianer', 'Seit einer grossen Hungersnot haben sich die Cardassianer auf die Nahrungsherstellung spezialisiert, haben aber den Abbau von Erzen vernachlässigt.\r\nIhre andere Stärke liegt in der Fähigkeit der Mutterschiffe zur Regeneration von ganzen Flottenverbänden.', 'Spezialist in der Nahrungsherstellung', '', '', '', 'Zentralrat der Cardassianer', 1.00, 1.00, 1.00, 0.90, 0.90, 1.20, 1.00, 1.60, 1.10, 1.30, 1),
	(10, 'Serrakin', 'Die Serrakin sind eine sehr friedliche Rasse, welche sich nicht gerne in grosse Auseinandersetzungen einmischt. Sie weiss sich aber bei Angriffen sehr gut zu wehren, da die Verteidigungstechnologie ihr Spezialgebiet ist.', 'Der Serrakin setzt auf die Verteidigung seiner Kolonien', 'serrakinischer', '', 'serrakinische', 'Beschützer der Serrakin', 1.00, 1.00, 0.90, 1.15, 1.15, 1.10, 0.95, 1.10, 1.40, 1.00, 1);
